import { Link } from "react-router-dom";
import style from "./Landing.module.css";

const Landing = () =>{
    return(
        <div className={style.Landing}>
            <div className={style.LandingText}>
                <h1>Discover the feactures of your favorite Pokemon</h1>
                <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/International_Pok%C3%A9mon_logo.svg/1280px-International_Pok%C3%A9mon_logo.svg.png" alt="png"></img>
            </div>
            <Link to="/home" className={style.Home}> 
                <p>S T A R T</p>
            </Link>
        </div>
    )
};

export default Landing;
